(function(){
    console.log("text2")
    window.addEventListener('resize', ()=>{
        const vh = window.innerHeight * 0.01;
        document.documentElement.style.setProperty("--vh", `${vh}px`)
        console.log("test")
    })
})()

console.log("test")
